import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';

ReactDOM.render(
    <>
        <Card 
        imgsrc='https://wallpapercave.com/wp/wp4995602.jpg' 
        title='A Netflix Original Series' sname='DARK' 
        link='https://www.netflix.com/in/title/80100172' />

        <Card 
            imgsrc='https://wallpapercave.com/wp/yXmbxhx.jpg' 
        title='Watch Friends on Netflix' sname='F.R.I.E.N.D.S' 
        link='https://www.netflix.com/in/title/70153404'  />

        <Card 
            imgsrc='https://wallpapercave.com/wp/wp4995602.jpg' 
            title='A Netflix Original Series' sname='DARK' 
            link='https://www.netflix.com/in/title/80100172' />

        <Card 
            imgsrc='https://wallpapercave.com/wp/yXmbxhx.jpg' 
            title='Watch Friends on Netflix' sname='F.R.I.E.N.D.S' 
            link='https://www.netflix.com/in/title/70153404'   />

        <Card 
            imgsrc='https://wallpapercave.com/wp/wp4995602.jpg' 
            title='A Netflix Original Series' sname='DARK' 
            link='https://www.netflix.com/in/title/80100172' />
    </>,
    document.getElementById('root')
);

